import React,{Component} from 'react';
import {headerLinks} from '@/common/local-data';

class Header extends Component {
    render(){
        return (
            <div>
                {
                    headerLinks.map((item) => (
                        <a href={item.link}>{item.title}</a>
                    ))
                }  
            </div>
        );
    }
}

export default Header;
